import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

import ProtectedRoute from "./components/ProtectedRoute";
import ProtectedInstructorRoute from "./components/ProtectedInstructorRoute";

// Auth Pages
import Login from "./pages/Login";
import AdminLogin from "./pages/admin/AdminLogin"; // ✅ ADD THIS
import InstructorRegister from "./pages/instructor/InstructorRegister";
import InstructorLogin from "./pages/instructor/InstructorLogin";

// Admin Pages
import Dashboard from "./pages/admin/Dashboard";
import Instructors from "./pages/admin/InstructorList";
import Courses from "./pages/admin/CourseList";
import AddCourse from "./pages/admin/AddCourse";
import AddInstructor from "./pages/admin/AddInstructor";
import AddLecture from "./pages/admin/AddLecture";

// Instructor Pages
import InstructorDashboard from "./pages/instructor/InstructorDashboard";
import MyLectures from "./pages/instructor/MyLectures";

function App() {
  return (
    <Router>
      <Routes>
        {/* Default Redirect */}
        <Route path="/" element={<Navigate to="/login" />} />
        {/* Combined Login Page */}
        <Route path="/login" element={<Login />} />
        {/* ADMIN AUTH */}
        <Route path="/admin/login" element={<AdminLogin />} /> {/* ✅ FIX */}
        {/* Instructor Auth Pages */}
        <Route path="/instructor/login" element={<InstructorLogin />} />
        <Route path="/instructor/register" element={<InstructorRegister />} />
        {/* ADMIN PROTECTED ROUTES */}
        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/instructors"
          element={
            <ProtectedRoute>
              <Instructors />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/courses"
          element={
            <ProtectedRoute>
              <Courses />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-course"
          element={
            <ProtectedRoute>
              <AddCourse />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-instructor"
          element={
            <ProtectedRoute>
              <AddInstructor />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-lecture"
          element={
            <ProtectedRoute>
              <AddLecture />
            </ProtectedRoute>
          }
        />
        {/* INSTRUCTOR PROTECTED ROUTES */}
        <Route
          path="/instructor/dashboard"
          element={
            <ProtectedInstructorRoute>
              <InstructorDashboard />
            </ProtectedInstructorRoute>
          }
        />
        <Route
          path="/instructor/my-lectures"
          element={
            <ProtectedInstructorRoute>
              <MyLectures />
            </ProtectedInstructorRoute>
          }
        />
        {/* Fallback */}
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}

export default App;
